CREATE TABLE `iranyitoszamok_varosok_2021` (
	`id` INT(10) AUTO_INCREMENT,
	`irsz` INT(4) UNSIGNED NOT NULL,
	`telepules` VARCHAR(60) NOT NULL,
	`telepulesresz` VARCHAR(60),
	PRIMARY KEY (`id`)
);
CREATE TABLE `citizens` (
	`citizen_id` BIGINT(20) NOT NULL AUTO_INCREMENT,
	`citizen_name` VARCHAR(200) NOT NULL COLLATE 'utf8_hungarian_ci',
	`zip` CHAR(4) NOT NULL COLLATE 'utf8_hungarian_ci',
	`age` BIGINT(20) NOT NULL,
	`email` VARCHAR(200) NOT NULL COLLATE 'utf8_hungarian_ci',
	`taj` VARCHAR(10) NOT NULL COLLATE 'utf8_hungarian_ci',
	`number_of_vaccination` BIGINT(20) NULL DEFAULT 0,
	`last_vaccination` DATETIME NULL DEFAULT NULL,
	PRIMARY KEY (`citizen_id`),
	UNIQUE INDEX `taj` (`taj`),
	UNIQUE INDEX `email` (`email`)
)
COLLATE='utf8_hungarian_ci';

CREATE TABLE `vaccinations` (
	`vaccination_id` BIGINT(20) NOT NULL AUTO_INCREMENT,
	`citizen_id` BIGINT(20) NOT NULL,
	`vaccination_date` DATETIME NOT NULL,
	`status` VARCHAR(10) NULL DEFAULT '' COLLATE 'utf8_hungarian_ci',
	`note` VARCHAR(200) NULL DEFAULT '' COLLATE 'utf8_hungarian_ci',
	`vaccination_type` VARCHAR(20),
	PRIMARY KEY (`vaccination_id`),
	CONSTRAINT `fk1_vaccinations`
		FOREIGN KEY (`citizen_id`) REFERENCES `citizens`(`citizen_id`)
		ON DELETE RESTRICT
		ON UPDATE RESTRICT
)
COLLATE='utf8_hungarian_ci';

CREATE TABLE `cities` (
	`city_id` BIGINT(20) NOT NULL AUTO_INCREMENT,
	`order_id` BIGINT(20) NOT NULL,
	`shipment_date` DATE NOT NULL,
	PRIMARY KEY (`city_id`)
)
COLLATE='utf8_hungarian_ci';

